        { name: "Fries", price: "3" },
        { name: "Soda", price: "2" },
        { name: "Water", price: "1" },
        { name: "Sandwich", price: "5" },
        { name: "Hot Dog", price: "4" },
        { name: "Coffee", price: "3" },
        { name: "Energy Drink", price: "4" },
        { name: "Nachos", price: "5" },
      ]);
    }

    // Initialize default users if no users exist
    if (existingUsers.length === 0) {
      const adminUsername = process.env.ADMIN_USERNAME;
      const adminPassword = process.env.ADMIN_PASSWORD;
      const staffUsername = process.env.STAFF_USERNAME;
      const staffPassword = process.env.STAFF_PASSWORD;

      if (!adminUsername || !adminPassword) {
        console.error('‚ùå ERROR: No admin user exists and ADMIN_USERNAME/ADMIN_PASSWORD environment variables are not set!');
        console.error('‚ùå Please set ADMIN_USERNAME and ADMIN_PASSWORD to create an admin user.');
        console.error('‚ùå The application will continue without users.');
        return;
      }

      if (adminPassword.length < 8) {
        console.error('‚ùå WARNING: ADMIN_PASSWORD must be at least 8 characters long. Admin user not created.');
      } else {
        // Create admin user (skip strict validation for initial setup)
        await this.createUser({
          username: adminUsername,
          password: adminPassword,
          role: "admin"
        }, true);
        console.log(`‚úÖ Admin user created with username: ${adminUsername}`);
      }

      // Create staff user if credentials provided
      if (staffUsername && staffPassword) {
        if (staffPassword.length < 8) {
          console.error('‚ùå WARNING: STAFF_PASSWORD must be at least 8 characters long. Staff user not created.');
        } else {
          await this.createUser({
            username: staffUsername,
            password: staffPassword,
            role: "staff"
          }, true);
          console.log(`‚úÖ Staff user created with username: ${staffUsername}`);
        }
      } else {
        console.log('‚ÑπÔ∏è  No staff user created. Set STAFF_USERNAME and STAFF_PASSWORD to create a staff user.');
      }
    } else {
      // Check if staff user needs to be created (even if admin exists)
      const staffUsername = process.env.STAFF_USERNAME;
      const staffPassword = process.env.STAFF_PASSWORD;

      if (staffUsername && staffPassword) {
        const staffUserExists = existingUsers.some(u => u.username === staffUsername);

        if (!staffUserExists) {
          if (staffPassword.length < 8) {
            console.error('‚ùå WARNING: STAFF_PASSWORD must be at least 8 characters long. Staff user not created.');
          } else {
            await this.createUser({
              username: staffUsername,
              password: staffPassword,
              role: "staff"
            }, true);
            console.log(`‚úÖ Staff user created with username: ${staffUsername}`);
