  }

  async getCustomerPromotionSummary(whatsappNumber: string): Promise<CustomerPromotionSummary> {
    const activeBookings = await db
      .select()
      .from(bookings)
      .where(eq(bookings.whatsappNumber, whatsappNumber));

    const historyBookings = await db
      .select()
      .from(bookingHistory)
      .where(eq(bookingHistory.whatsappNumber, whatsappNumber));

    const allBookings = [...activeBookings, ...historyBookings];

    let discountCount = 0;
    let bonusCount = 0;
    let totalSavings = 0;
    let totalBonusHours = 0;

    allBookings.forEach(booking => {
      if (booking.discountApplied && booking.promotionDetails?.discountAmount) {
        discountCount++;
        totalSavings += parseFloat(booking.promotionDetails.discountAmount);
      }
      if (booking.bonusHoursApplied && booking.promotionDetails?.bonusHours) {
        bonusCount++;
        totalBonusHours += parseFloat(booking.promotionDetails.bonusHours);
      }
    });

    return {
      discountCount,
      bonusCount,
      totalSavings,
      totalBonusHours
    };
  }

  async getPromotionHistoryByCustomer(whatsappNumber: string): Promise<PromotionHistoryItem[]> {
    const activeBookings = await db
      .select()
      .from(bookings)
      .where(eq(bookings.whatsappNumber, whatsappNumber));

    const historyBookings = await db
      .select()
      .from(bookingHistory)
      .where(eq(bookingHistory.whatsappNumber, whatsappNumber));

    const allBookings = [...activeBookings, ...historyBookings];

    const promotionHistory: PromotionHistoryItem[] = [];

    allBookings.forEach(booking => {
      if (booking.discountApplied && booking.promotionDetails?.discountAmount) {
        promotionHistory.push({
          bookingId: booking.id,
          seatName: booking.seatName,
          date: new Date(booking.startTime).toLocaleDateString('en-US', { 
            month: 'short', 
            day: 'numeric', 
            year: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
          }),
          promotionType: 'discount',
          discountPercentage: booking.promotionDetails.discountPercentage,
          discountAmount: booking.promotionDetails.discountAmount,
          originalPrice: booking.originalPrice || booking.price,
          finalPrice: booking.price
        });
      }

      if (booking.bonusHoursApplied && booking.promotionDetails?.bonusHours) {
        promotionHistory.push({
          bookingId: booking.id,
          seatName: booking.seatName,
          date: new Date(booking.startTime).toLocaleDateString('en-US', { 
            month: 'short', 
            day: 'numeric', 
            year: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
          }),
          promotionType: 'bonus',
          bonusHours: booking.promotionDetails.bonusHours,
          finalPrice: booking.price
        });
      }
    });

    return promotionHistory.sort((a, b) => new Date(b.date).getTime() - new Date(a.date).getTime());
  }

  // Staff Visibility Settings
  async getStaffVisibilitySettings(): Promise<StaffVisibilitySettings> {
    const settings = await db.select().from(staffVisibilitySettings).limit(1);

    if (settings.length === 0) {
      // Create default settings if none exist
      const defaultPages = {
        dashboard: true,
        bookings: true,
        history: true,
        food: true,
        inventory: false,
        expenses: false,
        ledger: false,
        analytics: false,
        maintenance: false,
        settings: false,
      };
      const defaultElements = {
        customerPhone: true,
        paymentDetails: true,
        revenueNumbers: false,
        expenseAmounts: false,
        profitLoss: false,
        costPrices: false,
      };

      const [newSettings] = await db.insert(staffVisibilitySettings).values({
        pages: defaultPages,
        elements: defaultElements,
      }).returning();

      return newSettings;
    }

    return settings[0];
  }

  async updateStaffVisibilitySettings(pages: VisibilityPages, elements: VisibilityElements): Promise<StaffVisibilitySettings> {
    const existingSettings = await db.select().from(staffVisibilitySettings).limit(1);

    if (existingSettings.length === 0) {
      const [newSettings] = await db.insert(staffVisibilitySettings).values({
        pages,
        elements,
      }).returning();
      return newSettings;
    }

    const [updated] = await db.update(staffVisibilitySettings)
      .set({ 
        pages, 
        elements,
        updatedAt: new Date()
      })
      .where(eq(staffVisibilitySettings.id, existingSettings[0].id))
      .returning();

    return updated;
  }

}

