import { useQuery } from "@tanstack/react-query";
import { useEffect, useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Badge } from "@/components/ui/badge";
import { Button } from "@/components/ui/button";
import { Monitor, Gamepad2, Glasses, Car, Cpu, RefreshCw, Phone, MapPin, Clock, Mail, ChevronDown, ChevronUp, Wifi, Wind, Armchair, Pizza } from "lucide-react";
import {
  Collapsible,
  CollapsibleContent,
  CollapsibleTrigger,
} from "@/components/ui/collapsible";
import { getAdjustedTime } from "@/hooks/useServerTime";

interface DeviceAvailability {
  category: string;
  total: number;
  available: number;
  occupied: number;
  percentage: number;
}

interface PricingConfig {
  id: string;
  category: string;
  duration: string;
  price: string;
}

interface Facility {
  id: string;
  name: string;
  description: string;
  icon: string;
}

const getIconForCategory = (category: string) => {
  const icons: Record<string, any> = {
    "PC": Monitor,
    "PS5": Gamepad2,
    "VR": Glasses,
    "Car": Car,
    "Xbox": Gamepad2,
    "Nintendo": Gamepad2,
  };
  return icons[category] || Cpu;
};

const getFacilityIcon = (iconName: string) => {
  const icons: Record<string, any> = {
    "wifi": Wifi,
    "air-conditioning": Wind,
    "gaming-chair": Armchair,
    "refreshments": Pizza,
    "monitor": Monitor,
    "gamepad": Gamepad2,
  };
  return icons[iconName] || Cpu;
};

const getProgressBarColor = (percentage: number) => {
  if (percentage >= 60) return "#22c55e";
  if (percentage >= 40) return "#eab308";
  return "#ef4444";
};

export default function PublicStatus() {
  const [lastUpdate, setLastUpdate] = useState(getAdjustedTime());
