import { createApiClient } from '@neondatabase/api-client';

interface DatabaseMetrics {
  name: string;
  projectId: string;
  storageBytes: number;
  storageMB: number;
  limitMB: number;
  percentUsed: number;
  computeTimeSeconds: number;
  activeTimeSeconds: number;
  quotaResetAt: string | null;
}

interface StorageMetricsResponse {
  databases: DatabaseMetrics[];
  totalStorageMB: number;
  totalLimitMB: number;
  totalPercentUsed: number;
  lastUpdated: string;
}

function extractProjectId(databaseUrl: string): string | null {
  try {
    const match = databaseUrl.match(/([a-z0-9-]+)\.([a-z0-9-]+)\.neon\.tech/);
    if (match) {
      return `${match[1]}-${match[2]}`;
    }
    return null;
  } catch {
    return null;
  }
}

export async function fetchNeonStorageMetrics(): Promise<StorageMetricsResponse> {
  const apiKey = process.env.NEON_API_KEY;

  if (!apiKey) {
    throw new Error('NEON_API_KEY is not configured');
  }

  const databases = [
    { name: 'Main', url: process.env.DATABASE_URL_MAIN || process.env.DATABASE_URL },
    { name: 'History', url: process.env.DATABASE_URL_HISTORY },
    { name: 'Payments', url: process.env.DATABASE_URL_PAYMENTS },
    { name: 'Expenses', url: process.env.DATABASE_URL_EXPENSES },
    { name: 'Logs', url: process.env.DATABASE_URL_LOGS },
    { name: 'Analytics', url: process.env.DATABASE_URL_ANALYTICS },
  ];

  const apiClient = createApiClient({
    apiKey,
  });

  const metrics: DatabaseMetrics[] = [];
  const FREE_TIER_LIMIT_MB = 512;

  for (const db of databases) {
    if (!db.url) {
      continue;
    }

    const projectId = extractProjectId(db.url);
    if (!projectId) {
      console.warn(`Could not extract project ID from ${db.name} database URL`);
      continue;
    }

    try {
      const response = await apiClient.getProject(projectId);
      const project = response.data.project;

      const storageBytes = project.synthetic_storage_size || 0;
      const storageMB = storageBytes / (1024 * 1024);
      const percentUsed = (storageMB / FREE_TIER_LIMIT_MB) * 100;

      metrics.push({
        name: db.name,
        projectId,
        storageBytes,
        storageMB: Math.round(storageMB * 100) / 100,
        limitMB: FREE_TIER_LIMIT_MB,
        percentUsed: Math.round(percentUsed * 100) / 100,
        computeTimeSeconds: project.compute_time_seconds || 0,
        activeTimeSeconds: project.active_time_seconds || 0,
        quotaResetAt: project.quota_reset_at || null,
      });
    } catch (error: any) {
      console.error(`Error fetching metrics for ${db.name}:`, error.message);
      metrics.push({
        name: db.name,
        projectId,
        storageBytes: 0,
        storageMB: 0,
        limitMB: FREE_TIER_LIMIT_MB,
        percentUsed: 0,
        computeTimeSeconds: 0,
        activeTimeSeconds: 0,
        quotaResetAt: null,
      });
    }
  }

  const totalStorageMB = metrics.reduce((sum, m) => sum + m.storageMB, 0);
  const TOTAL_LIMIT_MB = 3072; // 6 databases √ó 512 MB = 3 GB
  const totalPercentUsed = totalStorageMB > 0 ? (totalStorageMB / TOTAL_LIMIT_MB) * 100 : 0;

  return {
    databases: metrics,
    totalStorageMB: Math.round(totalStorageMB * 100) / 100,
    totalLimitMB: TOTAL_LIMIT_MB,
    totalPercentUsed: Math.round(totalPercentUsed * 100) / 100,
    lastUpdated: new Date().toISOString(),
  };
}

TIMEZONE_FIX.md.content:
# Timezone Conversion Fix - Analytics Charts

## Issue
The analytics charts were displaying time values in UTC (e.g., 14:00, 16:00) instead of India Standard Time (IST/Asia/Kolkata timezone).

## Solution Implemented
Updated the Analytics component (`client/src/pages/Analytics.tsx`) to automatically convert all UTC timestamps to IST before rendering in charts.

## Changes Made

### 1. Added Timezone Conversion Function
Created a `convertToIST()` function that handles two types of time formats:
- **Hour format** (e.g., "14:00"): Converts UTC hour to IST equivalent
- **Timestamp format** (e.g., "12:30:45"): Converts UTC timestamp to IST time

```typescript
const convertToIST = (utcTimeString: string, isHourFormat: boolean = false): string => {
  if (isHourFormat) {
    // Converts hour like "14:00" UTC to IST (19:30)
    const [hour] = utcTimeString.split(':').map(Number);
    const utcDate = new Date();
    utcDate.setUTCHours(hour, 0, 0, 0);
    return utcDate.toLocaleString('en-IN', { 
      timeZone: 'Asia/Kolkata',
      hour: '2-digit',
      minute: '2-digit',
      hour12: false
    });
  } else {
    // Converts timestamp to IST
    const now = new Date();
    const [time] = utcTimeString.split(' ');
    const [hours, minutes, seconds] = time.split(':').map(Number);
    now.setUTCHours(hours, minutes, seconds || 0, 0);
    return now.toLocaleString('en-IN', {
      timeZone: 'Asia/Kolkata',
      hour: '2-digit',
      minute: '2-digit',
      second: '2-digit',
      hour12: false
    });
  }
};
```

### 2. Data Transformation
Created a `transformedStats` object using `useMemo` that converts all time values to IST:
- `hourlyUsage[].hour`: Converted from UTC to IST
- `realtimeData[].timestamp`: Converted from UTC to IST

### 3. Updated All Charts
All Recharts components now use the transformed data with IST times:
- **Occupancy Trend** (AreaChart): Uses IST timestamps
- **Hourly Activity** (BarChart): Uses IST hour labels
- **Revenue & Bookings** (ComposedChart): Uses IST hour labels
- **Peak Hours** insights: Display IST times

## Time Offset
India Standard Time (IST) is UTC+5:30, so:
- 14:00 UTC ‚Üí 19:30 IST
- 16:00 UTC ‚Üí 21:30 IST

## Affected Charts
1. **Overview Tab**
   - Occupancy Trend chart
   - Hourly Activity chart

2. **Performance Tab**
   - Revenue & Bookings combined chart

3. **Insights Tab**
   - Peak Hours display

All time labels and tooltips now show the correct local time (Asia/Kolkata timezone).

