import Database from "better-sqlite3";
import { drizzle } from "drizzle-orm/better-sqlite3";
import * as schema from "../shared/schema-sqlite";
import path from "path";
import fs from "fs";
import os from "os";

function isElectronPackaged(): boolean {
  return (
    process.env.IS_PACKAGED === "true" ||
    process.env.NODE_ENV === "production" ||
    (process.execPath.includes("electron") &&
      !process.execPath.includes("node_modules"))
  );
}

function getDbPath(): string {
  if (process.env.USER_DATA_PATH) {
    return path.join(process.env.USER_DATA_PATH, "airavoto-gaming.db");
  }

  if (isElectronPackaged()) {
    const appName = "Airavoto Gaming POS";
    let userDataPath: string;

    if (process.platform === "win32") {
      userDataPath = path.join(os.homedir(), "AppData", "Roaming", appName);
    } else if (process.platform === "darwin") {
      userDataPath = path.join(
        os.homedir(),
        "Library",
        "Application Support",
        appName,
      );
    } else {
      userDataPath = path.join(os.homedir(), ".config", appName);
    }

    return path.join(userDataPath, "airavoto-gaming.db");
  }

  return path.join(process.cwd(), "data", "airavoto-gaming.db");
}

function ensureDbDirectory(dbPath: string): void {
  const dir = path.dirname(dbPath);
  if (!fs.existsSync(dir)) {
    fs.mkdirSync(dir, { recursive: true });
    console.log("Created database directory:", dir);
  }
}

function logDbInfo(message: string) {
  console.log(`[DB] ${message}`);
}

let dbPath: string;
let sqlite: Database.Database;
let db: ReturnType<typeof drizzle>;

try {
  dbPath = getDbPath();
  logDbInfo(`Database path: ${dbPath}`);
  logDbInfo(`Is packaged: ${isElectronPackaged()}`);
  logDbInfo(`Platform: ${process.platform}`);

  ensureDbDirectory(dbPath);

  sqlite = new Database(dbPath);
  sqlite.pragma("journal_mode = WAL");
  sqlite.pragma("foreign_keys = ON");
  sqlite.pragma("busy_timeout = 5000");

  db = drizzle(sqlite, { schema });
  logDbInfo("Database connection established successfully");
} catch (error: any) {
  console.error("[DB] Failed to initialize database:", error.message);
  console.error("[DB] Stack:", error.stack);
  throw error;
}

export { db, sqlite };

export function initializeSqliteDatabase() {
  try {
    sqlite.exec(`
      CREATE TABLE IF NOT EXISTS sessions (
        sid TEXT PRIMARY KEY,
        sess TEXT NOT NULL,
        expire INTEGER NOT NULL
      );

      CREATE TABLE IF NOT EXISTS session_groups (
