        group_id TEXT,
        group_code TEXT,
        category TEXT NOT NULL,
        seat_number INTEGER NOT NULL,
        seat_name TEXT NOT NULL,
        customer_name TEXT NOT NULL,
        whatsapp_number TEXT,
        start_time INTEGER NOT NULL,
        end_time INTEGER NOT NULL,
        price TEXT NOT NULL,
        status TEXT NOT NULL,
