      CREATE INDEX IF NOT EXISTS idx_bookings_status ON bookings(status);
      CREATE INDEX IF NOT EXISTS idx_bookings_start_time ON bookings(start_time);
      CREATE INDEX IF NOT EXISTS idx_booking_history_start_time ON booking_history(start_time);
      CREATE INDEX IF NOT EXISTS idx_activity_logs_created_at ON activity_logs(created_at);
      CREATE INDEX IF NOT EXISTS idx_notifications_is_read ON notifications(is_read);
      CREATE INDEX IF NOT EXISTS idx_payment_logs_created_at ON payment_logs(created_at);
    `);

    logDbInfo(`SQLite database initialized at: ${dbPath}`);
  } catch (error: any) {
    console.error("[DB] Failed to initialize database tables:", error.message);
    console.error("[DB] Stack:", error.stack);
    throw error;
  }
}

