  --shadow-xl: 0px 24px 48px 0px rgba(0, 0, 0, 0.8);
  --shadow-2xl: 0px 40px 64px 0px rgba(0, 0, 0, 0.85);

  --glass-bg: rgba(20, 25, 35, 0.6);
  --glass-border: rgba(255, 255, 255, 0.1);
  --glass-shadow: 0 8px 32px 0 rgba(0, 0, 0, 0.5);
}

@layer base {
  * {
    @apply border-border;
  }

  body {
    @apply font-sans antialiased text-foreground relative;
    background: linear-gradient(135deg, hsl(var(--background)) 0%, hsl(270 20% 95%) 50%, hsl(280 25% 92%) 100%);
    min-height: 100vh;
  }

  .dark body {
    background: linear-gradient(135deg, hsl(var(--background)) 0%, hsl(270 30% 12%) 50%, hsl(280 35% 10%) 100%);
  }

  /* Glass morphism effect */
  .glass {
    background: var(--glass-bg);
    backdrop-filter: blur(20px) saturate(180%);
    -webkit-backdrop-filter: blur(20px) saturate(180%);
    border: 1px solid var(--glass-border);
    box-shadow: var(--glass-shadow);
  }

  .glass-card {
    background: rgba(255, 255, 255, 0.75);
    backdrop-filter: blur(16px) saturate(180%);
    -webkit-backdrop-filter: blur(16px) saturate(180%);
    border: 1px solid rgba(255, 255, 255, 0.25);
    box-shadow: 0 8px 32px 0 rgba(31, 38, 135, 0.15);
    transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
  }

  .dark .glass-card {
    background: rgba(20, 25, 35, 0.65);
    border: 1px solid rgba(255, 255, 255, 0.1);
    box-shadow: 0 8px 32px 0 rgba(0, 0, 0, 0.5);
  }

  .glass-card:hover {
    transform: translateY(-2px);
    box-shadow: 0 12px 48px 0 rgba(31, 38, 135, 0.22);
  }

  .dark .glass-card:hover {
    box-shadow: 0 12px 48px 0 rgba(0, 0, 0, 0.7);
  }
}

/* Frosted glass utilities */
@layer utilities {
  .glass-button {
    @apply glass rounded-lg px-4 py-2 font-medium transition-all duration-300;
    @apply hover:scale-105 hover:shadow-lg active:scale-95;
  }

  .glass-input {
    @apply glass rounded-lg px-4 py-2 outline-none transition-all duration-300;
    @apply focus:ring-2 focus:ring-primary/50 focus:border-primary;
  }

  .glass-panel {
    @apply glass-card rounded-2xl p-6;
  }

  /* Hide ugly search cancel button in Chrome until we can style it properly */
  input[type="search"]::-webkit-search-cancel-button {
    @apply hidden;
  }

  /* Placeholder styling for contentEditable div */
  [contenteditable][data-placeholder]:empty::before {
    content: attr(data-placeholder);
    color: hsl(var(--muted-foreground));
    pointer-events: none;
  }

  .no-default-hover-elevate {}
  .no-default-active-elevate {}

  .toggle-elevate::before,
  .toggle-elevate-2::before {
    content: "";
    pointer-events: none;
    position: absolute;
    inset: 0px;
    border-radius: inherit;
    z-index: -1;
  }

  .toggle-elevate.toggle-elevated::before {
    background-color: var(--elevate-2);
  }

  .border.toggle-elevate::before {
    inset: -1px;
  }

  .hover-elevate:not(.no-default-hover-elevate),
  .active-elevate:not(.no-default-active-elevate),
  .hover-elevate-2:not(.no-default-hover-elevate),
  .active-elevate-2:not(.no-default-active-elevate) {
    position: relative;
    z-index: 0;
  }

  .hover-elevate:not(.no-default-hover-elevate)::after,
  .active-elevate:not(.no-default-active-elevate)::after,
  .hover-elevate-2:not(.no-default-hover-elevate)::after,
  .active-elevate-2:not(.no-default-active-elevate)::after {
    content: "";
    pointer-events: none;
    position: absolute;
    inset: 0px;
    border-radius: inherit;
    z-index: 999;
  }

  .hover-elevate:hover:not(.no-default-hover-elevate)::after,
  .active-elevate:active:not(.no-default-active-elevate)::after {
    background-color: var(--elevate-1);
  }

  .hover-elevate-2:hover:not(.no-default-hover-elevate)::after,
  .active-elevate-2:active:not(.no-default-active-elevate)::after {
    background-color: var(--elevate-2);
  }

  .border.hover-elevate:not(.no-hover-interaction-elevate)::after,
  .border.active-elevate:not(.no-active-interaction-elevate)::after,
  .border.hover-elevate-2:not(.no-hover-interaction-elevate)::after,
  .border.active-elevate-2:not(.no-active-interaction-elevate)::after,
  .border.hover-elevate:not(.no-hover-interaction-elevate)::after {
    inset: -1px;
  }

  /* Animated gradient backgrounds */
  .gradient-animate {
    background-size: 200% 200%;
    animation: gradient 8s ease infinite;
  }

  @keyframes gradient {
    0% { background-position: 0% 50%; }
    50% { background-position: 100% 50%; }
    100% { background-position: 0% 50%; }
  }

  @keyframes flip {
    0% {
      transform: rotateX(0deg);
    }
    100% {
      transform: rotateX(-180deg);
    }
  }

  .animate-flip {
    animation: flip 0.6s ease-in-out;
  }

  /* Glow effects */
  .glow {
    box-shadow: 0 0 20px rgba(157, 78, 221, 0.3);
  }

  .dark .glow {
    box-shadow: 0 0 30px rgba(157, 78, 221, 0.5);
  }

  /* Custom Rounded Corner Shapes */
  .shape-left-rounded {
    border-radius: 2rem 0.5rem 0.5rem 2rem;
  }

  .shape-diagonal-rounded {
    border-radius: 2rem 0.5rem 2rem 0.5rem;
  }

  .shape-right-rounded {
    border-radius: 0.5rem 2rem 2rem 0.5rem;
  }

  .shape-top-rounded {
    border-radius: 2rem 2rem 0.5rem 0.5rem;
  }

  .shape-bottom-rounded {
    border-radius: 0.5rem 0.5rem 2rem 2rem;
  }

  /* Rectangular cards with custom aspect ratios */
  .card-rectangular {
    aspect-ratio: 3 / 2;
    min-height: 140px;
  }

  .card-square-lg {
    aspect-ratio: 1 / 1;
    min-height: 160px;
  }

  /* ============================================
     CUSTOM GAMING SCROLLBAR - MINIMAL & INNOVATIVE
     ============================================ */

  /* Firefox */
  * {
    scrollbar-width: thin;
    scrollbar-color: hsl(270 75% 60% / 0.4) transparent;
  }

  .dark * {
    scrollbar-color: hsl(270 80% 70% / 0.5) transparent;
  }

  /* Webkit browsers (Chrome, Safari, Edge) */
  ::-webkit-scrollbar {
    width: 8px;
    height: 8px;
  }

  ::-webkit-scrollbar-track {
    background: transparent;
    border-radius: 100px;
  }

  ::-webkit-scrollbar-thumb {
    background: linear-gradient(
      180deg,
      hsl(270 75% 60% / 0.5) 0%,
      hsl(280 80% 65% / 0.6) 50%,
      hsl(290 70% 70% / 0.5) 100%
    );
    border-radius: 100px;
    border: 2px solid transparent;
    background-clip: padding-box;
    transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
  }

  ::-webkit-scrollbar-thumb:hover {
    background: linear-gradient(
      180deg,
      hsl(270 75% 60% / 0.8) 0%,
      hsl(280 80% 65% / 0.9) 50%,
      hsl(290 70% 70% / 0.8) 100%
    );
    box-shadow: 0 0 12px hsl(270 75% 60% / 0.6);
    transform: scaleX(1.2);
  }

  ::-webkit-scrollbar-thumb:active {
    background: linear-gradient(
      180deg,
      hsl(270 75% 60%) 0%,
      hsl(280 80% 65%) 50%,
      hsl(290 70% 70%) 100%
    );
    box-shadow: 0 0 20px hsl(270 75% 60% / 0.8);
  }

  /* Dark mode scrollbar */
  .dark ::-webkit-scrollbar-thumb {
    background: linear-gradient(
      180deg,
      hsl(270 80% 70% / 0.6) 0%,
      hsl(280 85% 75% / 0.7) 50%,
      hsl(290 75% 80% / 0.6) 100%
    );
  }

  .dark ::-webkit-scrollbar-thumb:hover {
    background: linear-gradient(
      180deg,
      hsl(270 80% 70% / 0.9) 0%,
      hsl(280 85% 75%) 50%,
      hsl(290 75% 80% / 0.9) 100%
    );
    box-shadow: 0 0 16px hsl(270 80% 70% / 0.8);
  }

  .dark ::-webkit-scrollbar-thumb:active {
    background: linear-gradient(
      180deg,
      hsl(270 80% 70%) 0%,
      hsl(280 85% 75%) 50%,
      hsl(290 75% 80%) 100%
    );
    box-shadow: 0 0 24px hsl(270 80% 70%);
  }

  /* Scrollbar corner (where vertical and horizontal scrollbars meet) */
  ::-webkit-scrollbar-corner {
    background: transparent;
  }

  /* Enhanced glow effect on scroll */
  @keyframes scrollGlow {
    0%, 100% { 
      box-shadow: 0 0 8px hsl(270 75% 60% / 0.4);
    }
    50% { 
      box-shadow: 0 0 16px hsl(270 75% 60% / 0.8);
    }
  }

  /* Smooth scroll behavior */
  html {
    scroll-behavior: smooth;
  }
}

