import ConsumerGames from "@/pages/ConsumerGames";
import NotFound from "@/pages/not-found";
import Login from "@/pages/Login";
import { ConsumerNav } from "@/components/ConsumerNav";
import { CursorTrail } from "@/components/CursorTrail";
import { SplashScreen } from "@/components/SplashScreen";
import { NetworkAlert } from "@/components/NetworkAlert";
import { NotificationCenter } from "@/components/NotificationCenter";
import { InactivityRefreshPrompt } from "@/components/InactivityRefreshPrompt";
import { FlipClock } from "@/components/FlipClock";
import { useState, useEffect } from "react";
import { useToast } from "@/hooks/use-toast";
import { useNetworkMonitor } from "@/hooks/useNetworkMonitor";

function Router() {
  return (
    <Switch>
      <Route path="/" component={Dashboard} />
      <Route path="/dashboard" component={Dashboard} />
      <Route path="/timeline" component={Timeline} />
      <Route path="/history" component={History} />
      <Route path="/activity-logs" component={ActivityLogs} />
      <Route path="/analytics" component={Analytics} />
      <Route path="/ai-maintenance" component={AIMaintenance} />
      <Route path="/food" component={Food} />
      <Route path="/inventory" component={Inventory} />
      <Route path="/expenses" component={Expenses} />
      <Route path="/settings" component={Settings} />
      <Route path="/reports" component={Reports} />
      <Route path="/terms" component={TermsAndConditions} />
      <Route component={NotFound} />
    </Switch>
  );
}

interface User {
  id: string;
  username: string;
  role: "admin" | "staff";
}

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [user, setUser] = useState<User | null>(null);
  const [showLogin, setShowLogin] = useState(false);
  const [showSplash, setShowSplash] = useState(true);
  const [showShortcuts, setShowShortcuts] = useState(false);
  const { toast } = useToast();
  const [, setLocation] = useLocation();
  const { showAlert, handleRefresh, handleDismiss } = useNetworkMonitor();

  const style = {
    "--sidebar-width": "16rem",
  };

  const handleLoginSuccess = (userData: User) => {
    setUser(userData);
    setIsAuthenticated(true);
    setShowLogin(false);
  };

  const handleLock = async () => {
    try {
      await authLogout();
      setUser(null);
      setIsAuthenticated(false);
      setShowLogin(true);
      toast({
        title: "Locked",
        description: "Please login again to continue",
      });
    } catch (error) {
      toast({
        title: "Error",
        description: "Failed to logout",
        variant: "destructive",
      });
    }
  };


  // Define global keyboard shortcuts
  const globalShortcuts: KeyboardShortcut[] = [
    {
      key: '?',
      shiftKey: true,
      description: 'Show keyboard shortcuts',
      action: () => setShowShortcuts(true),
      category: 'General'
    },
    {
      key: 'k',
      ctrlKey: true,
      description: 'Show keyboard shortcuts',
      action: () => setShowShortcuts(true),
      category: 'General'
    },
    {
      key: 'l',
      ctrlKey: true,
      description: 'Lock screen',
      action: handleLock,
      category: 'General'
    },
    {
      key: 't',
      ctrlKey: true,
      description: 'Toggle theme',
      action: () => {
        const themeToggle = document.querySelector('[data-testid="button-toggle-theme"]') as HTMLButtonElement;
        themeToggle?.click();
      },
      category: 'General'
    },
    {
      key: 'b',
      ctrlKey: true,
      description: 'Toggle sidebar',
      action: () => {
        const sidebarToggle = document.querySelector('[data-testid="button-sidebar-toggle"]') as HTMLButtonElement;
        sidebarToggle?.click();
      },
      category: 'General'
    },
    {
      key: '1',
      altKey: true,
      description: 'Go to Dashboard',
      action: () => setLocation('/'),
      category: 'Navigation'
    },
    {
      key: '2',
      altKey: true,
      description: 'Go to Timeline',
      action: () => setLocation('/timeline'),
      category: 'Navigation'
    },
    {
      key: '3',
      altKey: true,
      description: 'Go to History',
      action: () => setLocation('/history'),
      category: 'Navigation'
    },
    {
      key: '4',
      altKey: true,
      description: 'Go to Activity Logs',
      action: () => setLocation('/activity-logs'),
      category: 'Navigation'
    },
    {
      key: '5',
      altKey: true,
      description: 'Go to Analytics',
      action: () => setLocation('/analytics'),
      category: 'Navigation'
    },
    {
      key: '6',
      altKey: true,
      description: 'Go to Food Management',
      action: () => setLocation('/food'),
      category: 'Navigation'
    },
    {
      key: '7',
      altKey: true,
      description: 'Go to Expenses',
      action: () => setLocation('/expenses'),
      category: 'Navigation'
    },
    {
      key: '8',
      altKey: true,
      description: 'Go to Settings',
      action: () => setLocation('/settings'),
      category: 'Navigation'
    },
    {
      key: '9',
      altKey: true,
      description: 'Go to Reports',
      action: () => setLocation('/reports'),
      category: 'Navigation'
    }
  ];

  // Register global shortcuts
  useKeyboardShortcuts(globalShortcuts);

  useEffect(() => {
    // Check if user is already authenticated via session
    const checkAuth = async () => {
      try {
        // Initialize Tauri auth (creates default admin if needed)
        if (isTauri()) {
          console.log('Running in Tauri desktop mode...');
          const tauriInitSuccess = await initializeTauriAuth();
          if (!tauriInitSuccess) {
            console.error('Tauri initialization failed, continuing with login...');
          }
        }

        const userData = await getCurrentUser();
        if (userData && userData.id) {
          setUser(userData as User);
          setIsAuthenticated(true);
        } else {
          setShowLogin(true);
        }
      } catch (error) {
        console.error('Auth check error:', error);
        setShowLogin(true);
      }
    };
    checkAuth();
  }, []);

  if (showSplash) {
    return (
      <ThemeProvider>
        <SplashScreen onComplete={() => setShowSplash(false)} />
      </ThemeProvider>
    );
  }

  if (!isAuthenticated) {
    return (
      <ThemeProvider>
        <QueryClientProvider client={queryClient}>
          <TooltipProvider>
            <Switch>
              <Route path="/status" component={PublicStatus} />
              <Route path="/analytics" component={Analytics} />
              <Route path="/history" component={History} />
              <Route path="/home">
                <ConsumerNav />
                <Home />
              </Route>
              <Route path="/gallery">
                <ConsumerNav />
                <ConsumerGallery />
              </Route>
              <Route path="/facilities">
                <ConsumerNav />
                <ConsumerFacilities />
              </Route>
              <Route path="/games">
                <ConsumerNav />
                <ConsumerGames />
              </Route>
              <Route path="/staff">
                <Login onLoginSuccess={handleLoginSuccess} />
              </Route>
              <Route>
                <Login onLoginSuccess={handleLoginSuccess} />
              </Route>
            </Switch>
            <CursorTrail />
            <Toaster />
          </TooltipProvider>
        </QueryClientProvider>
      </ThemeProvider>
    );
  }

  return (
    <ThemeProvider>
      <QueryClientProvider client={queryClient}>
        <ShortcutsProvider globalShortcuts={globalShortcuts}>
          <AuthProvider user={user}>
            <TourProvider>
              <TooltipProvider>
                <SidebarProvider style={style as React.CSSProperties}>
                  <div className="flex h-screen w-full">
                    <AppSidebar />
                    <div className="flex flex-col flex-1 min-w-0">
                      <header className="flex items-center justify-between p-3 md:p-4 border-b sticky top-0 z-50 bg-background/95 backdrop-blur supports-[backdrop-filter]:bg-background/80">
                        <SidebarTrigger data-testid="button-sidebar-toggle" data-joyride="sidebar-toggle" />
                        <div className="flex items-center gap-2 md:gap-4">
                          {user && (
                            <div className="text-xs md:text-sm font-medium hidden sm:block" data-testid="text-user-info">
                              {user.username} <span className="text-xs text-muted-foreground hidden md:inline">({user.role})</span>
                            </div>
                          )}
                          <div className="hidden md:block">
                            <FlipClock />
                          </div>
                          <div data-joyride="notification-center">
                            <NotificationCenter />
                          </div>
                          <div data-joyride="theme-toggle">
                            <ThemeToggle />
                          </div>
                          <Button
                            variant="ghost"
                            size="icon"
                            onClick={() => setShowShortcuts(true)}
                            data-testid="button-shortcuts"
                            aria-label="Keyboard shortcuts"
                            className="h-8 w-8 md:h-10 md:w-10"
                          >
                            <Keyboard className="h-4 w-4 md:h-5 md:w-5" />
                          </Button>
                          <TakeTourButton />
                          <Button
                            variant="ghost"
                            size="icon"
                            onClick={handleLock}
                            data-testid="button-lock"
                            aria-label="Lock screen"
                            className="h-8 w-8 md:h-10 md:w-10"
                          >
                            <Lock className="h-4 w-4 md:h-5 md:w-5" />
                          </Button>
                        </div>
                      </header>
                      <main className="flex-1 overflow-auto p-3 sm:p-4 md:p-6">
                        <Router />
                      </main>
                    </div>
                  </div>
                </SidebarProvider>
                <KeyboardShortcutsDialog 
                  open={showShortcuts} 
                  onOpenChange={setShowShortcuts}
                />
                <NetworkAlert 
                  open={showAlert}
                  onRefresh={handleRefresh}
                  onDismiss={handleDismiss}
                />
                <InactivityRefreshPrompt />
                <CursorTrail />
                <Toaster />
              </TooltipProvider>
            </TourProvider>
          </AuthProvider>
        </ShortcutsProvider>
      </QueryClientProvider>
    </ThemeProvider>
  );
}

function TakeTourButton() {
  const { startTour } = useTour();

  return (
    <Button
      variant="ghost"
      size="sm"
      onClick={startTour}
      data-testid="button-take-tour"
      data-joyride="take-tour-button"
      aria-label="Take Tour"
      className="hidden sm:flex items-center gap-1"
    >
      <Sparkles className="h-4 w-4" />
      <span className="hidden md:inline">Take Tour</span>
    </Button>
  );
}

export default App;

